import Swimmer from "../img/swimmer.png";
import star from "../img/redstart.png";
function Card() {
  return (
    <div className="card">
      <img className="swimmer" src={Swimmer} />
      <div>
        <img className="star" src={star} />
        <span>5.0</span>
        <span>(6)</span>
        <span>USA</span>
      </div>
      <p>Life lessons with Katie Zaferes</p>
      <p>From $136 / person</p>
    </div>
  );
}

export default Card;
